- Сертифицированный фитнес-тренер;
- Сертифицированный спортивный диетолог-нутрициолог ;
- Сертифицированный специалист по лечебной физкультуре;
- Писатель:
Автор книги "Красивая и здоровая мама. Беременность и восстановление после родов"
Автор книги "Начни прямо сейчас! Здоровый подход к телу"
Автор книги "Фитнес -рецепты от Арины Скоромной"
Автор книги "Фитнес-мама"
- Член Союза писателей России
- Создатель "Дневника мотивации"
- Автор множества статей в самых авторитетных СМИ;
- Автор популярных видеотренингов, соавтор и ведущая популярного спортивного проекта «Телу время».  http://www.youtube.com/user/SkoromnayaArina ;
- Автор методики по восстановлению после родов, автор блога для беременных и кормящих ;
