- Обладает личным опытом похудения с 72 кг и приведения тела в идеальную форму после родов.
- Один из главных разработчиков популярной программы FIT FOR YOU ;
- Обладатель премии "Лучший инста зож блогер" по версии Crocus group.
- Создатель антицеллюлитного комплекса fatbuster by Arina Skoromnaya.
